import React from 'react'

const Settings = () => {
  return (
    <>
      <div className='text-center mt-3'>
        <img src="/image/settings.png" className='mt-1' style={{ padding: '10px', height: '9em', filter: 'drop-shadow(2px 8px 1px)' }} alt="" />
      </div>
    </>
  )
}

export default Settings
